import { connect } from "react-redux";

import searchReposActions from "store/repoSearch/actions";
import { Header } from "components";

function HomePage({ fetchSearch }) {
  fetchSearch({
    q: "js",
    sort: "stars",
    order: "desc",
    per_page: 30,
    page: 1,
  });
  // Promise.all([
